		  <text x="982" y="1202"  class="fil13 fnt12">Hojas memebretadas</text>
		  <text x="15" y="1271"  class="fil13 fnt13">Estamos seguros de que su inspiración y buen gusto, combinado con nuestras habilidades técnicas, dará como resultado un producto </text>
		  <text x="15" y="1296"  class="fil13 fnt13">impreso extremadamente profesional, capaz de competir con cualquiera del mercado.</text>
		  <text x="15" y="1346"  class="fil13 fnt13">También somos muy competitivos y creemos que ofrecemos la mejor relación calidad-precio en impresión digital de volantes, afiches, </text>
		  <text x="15" y="1371"  class="fil13 fnt13">tarjetas profesionales, carpetas, hojas y sobres membretados, stickers y pegotines, folletos, calendarios, tarjetas de felicitación </text>
		  <text x="15" y="1396"  class="fil13 fnt13">personalizadas, postales, invitaciones, manteles individuales, vinilos textiles personalizados, entradas, marcalibros, revistas y catálogos, </text>
		  <text x="15" y="1421"  class="fil13 fnt13">bloc organizadores, libretas y cuadernos personalizados, agendas personalizadas ya sea su pedido grande o pequeño. </text>
		 </g>
